    while i < len(array): 
        if array[i-1] <= array[i]: 
            i += 1
        else: 
            array[i-1], array[i] = array[i], array[i-1] 
            i -= 1
            if (i == 0): 
                i = 1
    return array

def binary_search(arr, x): 
    l = 0
    r = len(arr) - 1

    while l <= r: 
        mid = l + (r - l) // 2
        if arr[mid] == x: 
            return mid 
        elif arr[mid] < x: 
            l = mid + 1
        else: 
            r = mid - 1

    return -1

