function searchElement(arr, x) {
 let start = 0;
 let end = arr.length - 1;
 let mid;

 while (start <= end) {
  mid = Math.floor((start + end) / 2);
  if (arr[mid] === x) {
   return mid;
  }
  if (arr[mid] < x) {
   start = mid + 1;
  } else {
   end = mid - 1;
  }
 }

 return false;
}

