char* reverseString(char* str) {
    int length = strlen(str);
    char* revString = (char*) malloc(length + 1);

    for (int i = 0; i < length; i++) {
        revString[i] = str[length - i - 1];
    }
    revString[length] = '\0';

    return revString;
}

def is_prime(n):
    """
    This function will check if a given number is prime or not.
    """
    if n <= 1:
        return False
    for i in range(2, int(n**0.5) + 1):
        if n % i == 0:
            return False
    return True

def generate_list_of_primes(n):
    """
    This function will generate a list of all the prime numbers in the range from 0 to the given number n.
    """
    primes = []
    for i in range(2, n + 1):
        if is_prime(i):
            primes.append(i)
    return primes

