// bucket sort
function bucketSort(arr) {
  let buckets = new Array(arr.length); 
  let result = []; 

  for (let i = 0; i < arr.length; i++) {
    buckets[i] = 0;
  }

  for (let i = 0; i < arr.length; i++) {
    buckets[arr[i]]++;
  }

  for (let i = 0; i < arr.length; i++) {
    while (buckets[i] > 0) {
      result.push(i);
      buckets[i]--;
    }
  }

  return result;
}

