public class BinarySearchTree { 

  /* Class containing left, right and root nodes */
  class Node { 
    int key; 
    Node left, right; 

    public Node(int item) {
		key = item; 
		left = right = null; 
	} 
  } 

  // Root of BST 
  Node root; 

  // Constructor 
  BinarySearchTree() {  
	root = null;  
  } 

  // This method mainly calls insertRec() 
  void insert(int key) { 
	 root = insertRec(root, key); 
  } 

  /* A recursive function to insert a new key in BST */
  Node insertRec(Node root, int key) { 

	// When the tree is empty, return a new node 
	if (root == null) { 
		root = new Node(key); 
		return root; 
	}

	// Otherwise, recurr down the tree 
	if (key < root.key) 
		root.left = insertRec(root.left, key); 
	else if (key > root.key) 
		root.right = insertRec(root.right, key);

	// return the root 
	return root; 
  } 

}

def quick_sort(A):
    quick_sort_helper(A, 0, len(A) - 1)

def quick_sort_helper(A, start, end):
    if start < end:
        p_index = partition_list(A, start, end)
        quick_sort_helper(A, start, p_index - 1)
        quick_sort_helper(A, p_index + 1, end)

def partition_list(A, start, end):
    pivot = A[end]
    p_index = start
    for i in range(start, end):
        if A[i] <= pivot:
            A[i], A[p_index] = A[p_index], A[i]
            p_index += 1
    A[p_index], A[end] = A[end] , A[p_index]
    return p_index

